                    { 28, 1, null, null, null, null, "r28.docx", "04605c6c-7610-48a2-9e29-b51d3fdc5ee8", null, "abilovsky8@printfriendly.com", true, null, null, "Mobile app entrepreneur and developer with a track record of launching successful apps on both iOS and Android platforms. Skilled in market research, app monetization strategies, and app store optimization (ASO). Passionate about creating innovative mobile solutions that address real-world problems.", false, false, null, null, null, "$2a$04$1omTyh/5BRKbTlj4T4ntresw.Jah37pQdWRByBHy.2hOoWyWMQk3a", null, true, "i28.png", null, null, (short)1, false, "Alexandro Bilovsky" },
                    { 29, 10, null, null, null, null, "r29.docx", "9fc1aa9c-38ff-467f-af51-9895fdc5ff1b", null, "edorsey9@hc360.com", true, null, null, "Nghiên cứu viên UX có kinh nghiệm với lịch sử trong lĩnh vực tương tác người-máy. Có kinh nghiệm trong phương pháp nghiên cứu chất lượng và lượng, bao gồm phỏng vấn người dùng, khảo sát và kiểm tra tính khả dụng. Thạo việc tổng hợp các kết quả nghiên cứu để hỗ trợ quyết định thiết kế và cải thiện trải nghiệm người dùng.", true, false, null, null, null, "$2a$04$n30zXjTuTTbmcuN9cA6I.eblO8E4/JL1p9OIKzgkiu7MGAAGyB4Ya", null, false, "i29.png", null, null, (short)1, true, "Emmet Dorsey" },
                    { 30, 4, null, null, null, null, "r30.pdf", "7002a45e-a7fd-4c41-b1cf-ec568d97cb9f", null, "cgoldsberrya@shareasale.com", false, null, null, "Nhà nghiên cứu UX chuyên về phân tích hành vi người dùng và đồng hành. Thạo việc thu thập và phân tích dữ liệu người dùng để xác định các vấn đề và cơ hội cải thiện. Có kinh nghiệm trong việc làm việc cùng các nhóm chức năng khác nhau để chuyển đổi những hiểu biết nghiên cứu thành các đề xuất thiết kế hành động.", false, false, null, null, null, "$2a$04$IXQDrcm52R..rKAOy0WTP.IXQVPdpS5y5YS/thyvNdXPoQ0lH7dZ6", null, false, "i30.png", null, null, (short)1, false, "Cahra Goldsberry" },
                    { 31, 10, null, null, null, null, "r31.pdf", "a26430cd-f7bb-4340-aeaa-ee540509891b", null, "pwulfingerb@posterous.com", true, null, null, "Nhà nghiên cứu UX có chuyên môn về tâm lý học hành vi con người. Có kinh nghiệm trong việc tiến hành các nghiên cứu người dùng, đánh giá tiêu chuẩn và kiểm tra hành trình tư duy. Thạo việc áp dụng các nguyên lý tâm lý học vào việc thiết kế giao diện người dùng.", true, true, null, null, null, "$2a$04$hH/0kPq.q9I9KsD/lmHE9eJQ.D2QsDu2v.15O7vRxWiiTL8cHLxe2", null, false, "i31.png", null, null, (short)0, true, "Paulette Wulfinger" },
                    { 32, 10, null, null, null, null, "r32.pdf", "72d84d0e-6662-4765-bb35-79f5f393d796", null, "ewesgatec@china.com.cn", true, null, null, "Nhà nghiên cứu UX với sự chú trọng vào khả năng tiếp cận và thiết kế bao gồm mọi người. Có kinh nghiệm trong việc tiến hành kiểm tra khả dụng và kiểm tra hành vi với các nhóm người dùng đa dạng, bao gồm cả những người khuyết tật. Thạo việc thúc đẩy các nguyên tắc thiết kế có sẵn và tuân thủ các hướng dẫn về tiếp cận.", true, true, null, null, null, "$2a$04$lx0OqGz.N4PNpbXT18LQI.LIRw03DGzpNWet/nlAJwjCdaD6nphoi", null, true, "i32.png", null, null, (short)1, true, "Eberto Wesgate" },
                    { 33, 2, null, null, null, null, "r33.pdf", "cdd7b23d-1352-413a-ae0f-52bb9378ce37", null, "jfaircleyd@upenn.edu", false, null, null, "Nhà nghiên cứu UX chuyên về nghiên cứu dân số và phân loại người dùng. Thạo việc xác định các nhân vật người dùng, tiến hành phân tích cạnh tranh và thu thập thông tin thị trường để hỗ trợ chiến lược sản phẩm. Có kinh nghiệm trong việc áp dụng các phương pháp dựa trên dữ liệu để tối ưu hóa trải nghiệm người dùng.", false, false, null, null, null, "$2a$04$nm9YQ1icfNU4CizCPQonmehLkZZmv6E2OLXIz2z/kXQqgbSyfC0cq", null, true, "i33.png", null, null, (short)1, true, "Jacky Faircley" },
                    { 34, 6, null, null, null, null, "r34.pdf", "9697cc8c-db81-40db-8220-51ccb169500a", null, "bcatleye@wikispaces.com", true, null, null, "Nhà nghiên cứu UX với sự chuyên sâu trong phân tích nghiên cứu dân tộc và kiểm tra ngữ cảnh. Thạo việc tiến hành các nghiên cứu trường học và quan sát để hiểu hành vi người dùng trong môi trường thực tế. Có kinh nghiệm trong việc chuyển đổi những hiểu biết về dân tộc thành cơ hội thiết kế cho các sản phẩm và dịch vụ số.", true, false, null, null, null, "$2a$04$j6twwudj2WPEO76NUsqDdOBew7PO4Rc7BpFiwbGVq48tvXq6PTegi", null, false, "i34.png", null, null, (short)0, true, "Bertie Catley" },
                    { 35, 7, null, null, null, null, "r35.pdf", "3b29f90a-bef3-40f1-bfb6-6c6019f42357", null, "esaylorf@last.fm", false, null, null, "Nhà nghiên cứu UX với sự chuyên sâu về an toàn và thiết kế bao gồm mọi người. Có kinh nghiệm trong việc tiến hành kiểm tra khả dụng và kiểm tra hành vi với các nhóm người dùng đa dạng, bao gồm cả những người khuyết tật. Thạo việc thúc đẩy các nguyên tắc thiết kế có sẵn và tuân thủ các hướng dẫn về an toàn.", true, false, null, null, null, "$2a$04$XZTxljewq5F7en46SZj9R.y8Z7wz0dHdrdGAG2NO36WR3sCo6PrMG", null, true, "i35.png", null, null, (short)1, true, "Evelina Saylor" },
                    { 36, 3, null, null, null, null, "r36.pdf", "70a19fc3-5fdc-48ef-aa35-e450dcfd2a7a", null, "cfitzackerleyg@miitbeian.gov.cn", false, null, null, "Nhà nghiên cứu UX mới bắt đầu nhiệt huyết với sự học hỏi và đóng góp cho các dự án nghiên cứu. Thạo việc tiến hành phỏng vấn người dùng, kiểm tra tính khả dụng và khảo sát để thu thập phản hồi và hiểu biết từ người dùng. Hăng hái hợp tác với các nhà nghiên cứu kinh nghiệm để cải thiện chức năng và trải nghiệm của sản phẩm.", true, true, null, null, null, "$2a$04$pBof1tLNUgaAQRbOm7ENmeuZoJr96dn1PLtpsgrveEdHXCG0buKy2", null, true, "i36.png", null, null, (short)0, false, "Chas Fitzackerley" },
                    { 37, 7, null, null, null, null, "r37.pdf", "3b60165e-d97f-446a-b2f6-fddee5e3f69a", null, "sohowbaneh@globo.com", true, null, null, "Nhà nghiên cứu UX với sự chuyên sâu về số liệu và phân tích. Có kinh nghiệm trong việc xác định các chỉ số hiệu suất chính, thiết lập các công cụ phân tích và phân tích dữ liệu người dùng để đo lường và cải thiện hiệu suất UX. Thạo việc trực quan hóa dữ liệu và truyền đạt hiểu biết cho các bên liên quan một cách hiệu quả.", false, false, null, null, null, "$2a$04$lS.n44udNYDZVUqDRgbwp.1F0VZgNhSAl20Sqynr4Xo.wGt15ypDC", null, true, "i37.png", null, null, (short)1, true, "Sharity O'Howbane" },
                    { 38, 7, null, null, null, null, "r38.pdf", "f1c4306b-baee-4d80-aaa0-a2c96efefe8e", null, "nmatysiaki@amazonaws.com", false, null, null, "Nhà nghiên cứu UX với sự chuyên sâu trong việc thực hiện nghiên cứu về tâm lý học và kinh tế học hành vi. Có kinh nghiệm trong việc áp dụng các lý thuyết tâm lý học vào nghiên cứu UX, chẳng hạn như các heuristics quyết định và mô hình tư duy. Thạo việc tiến hành các nghiên cứu theo dõi mắt và kiểm tra A/B để tối ưu hóa giao diện người dùng và tương tác.", true, false, null, null, null, "$2a$04$T3Vij/zpGwLiHr8q22CBT.HSMGzlNNYVU4YhAOJZ0kU5uPhI4mgxa", null, true, "i38.png", null, null, (short)1, true, "Nikoletta Matysiak" },
                    { 39, 3, null, null, null, null, "r39.pdf", "8fbc4738-52df-4ed7-9517-aad944fb9c08", null, "dkobierzyckij@yahoo.com", true, null, null, "Kỹ sư Machine Learning có kinh nghiệm trong việc xây dựng và triển khai các mô hình học máy. Thạo việc tiền xử lý dữ liệu, lựa chọn mô hình phù hợp và tinh chỉnh tham số để đạt được hiệu suất tốt nhất. Sẵn lòng tham gia vào các dự án thú vị và học hỏi từ những kỹ sư hàng đầu.", false, true, null, null, null, "$2a$04$AL64EqKymYrsBb/mwy2v0.uH3Ye7R0a4lK.YhCIlF4EZEk/TkWD3q", null, true, "i39.png", null, null, (short)0, true, "Darda Kobierzycki" },
                    { 40, 10, null, null, null, null, "r40.pdf", "8906989f-199e-4788-bdbb-58d23ea830ab", null, "awatchornk@bigcartel.com", true, null, null, "Kỹ sư Machine Learning với kiến thức vững về học sâu và học máy. Có kinh nghiệm trong việc áp dụng các mô hình CNN, RNN, và Transformer cho các bài toán nhận diện, dự đoán và dịch ngôn ngữ. Nhiệt tình với việc nghiên cứu và áp dụng các công nghệ mới nhất trong lĩnh vực.", true, true, null, null, null, "$2a$04$R7Et/9gWTUMrsrjE2t3h9.bI10ezjnl5YJjtdmRrWQSDOQtulPx6i", null, false, "i40.png", null, null, (short)0, true, "Arielle Watchorn" },
                    { 41, 10, null, null, null, null, "r41.pdf", "5e7bd473-5ac2-49fb-95c1-d765201a350d", null, "eewensonl@google.com.hk", false, null, null, "Kỹ sư Machine Learning chuyên sâu về thị giác máy tính và xử lý ảnh. Có kinh nghiệm trong việc xây dựng các hệ thống nhận diện khuôn mặt, phát hiện vật thể và phân tích hình ảnh y tế. Sẵn lòng tìm hiểu và thử nghiệm các phương pháp mới để cải thiện hiệu suất của các ứng dụng.", false, true, null, null, null, "$2a$04$pYXTTsJ8GeRmnUP2DZHwWuUUruSwAEm2aonwARv.O7dDgPa9PGeq6", null, false, "i41.png", null, null, (short)1, false, "Elnar Ewenson" },
                    { 42, 8, null, null, null, null, "r42.pdf", "887e7ebc-405f-4690-8d66-6e7b6cb38d7c", null, "rschindlerm@ebay.com", false, null, null, "Kỹ sư Machine Learning với kỹ năng tốt về xử lý dữ liệu lớn và học máy phân tán. Có kinh nghiệm trong việc triển khai các mô hình học máy trên cơ sở dữ liệu phân tán và hệ thống phân tán. Sẵn lòng tham gia vào các dự án có quy mô lớn và phức tạp.", false, false, null, null, null, "$2a$04$Ewz8pVwm1Uxz4S01.LIgLe3Q/JHk/SJb4R1h8.NtWgfyrusGAMYY6", null, true, "i42.png", null, null, (short)0, true, "Roldan Schindler" },
                    { 43, 2, null, null, null, null, "r43.pdf", "75b91c93-560b-4be9-b74a-e2ebf658b5c0", null, "vhonschn@nature.com", false, null, null, "Kỹ sư Machine Learning có chuyên môn về xử lý ngôn ngữ tự nhiên và hiểu ngôn ngữ tự nhiên. Có kinh nghiệm trong việc xây dựng các hệ thống gợi ý, phân loại văn bản và dịch máy. Nhiệt tình với việc áp dụng học sâu và phương pháp trích xuất thông tin để giải quyết các thách thức trong lĩnh vực này.", true, false, null, null, null, "$2a$04$B7.HuHmcItU.ZdKOtAk/Me3FuantzbaX8rCW890RfHnV29a.YoNC2", null, false, "i43.png", null, null, (short)1, false, "Vina Honsch" },
                    { 44, 4, null, null, null, null, "r44.pdf", "9df77d46-c53b-43f8-8529-b31aa65a8b49", null, "hnoelo@biblegateway.com", true, null, null, "Kỹ sư Machine Learning với kiến thức vững về học tăng cường và học máy tăng cường. Có kinh nghiệm trong việc áp dụng các thuật toán Q-learning, DQN và các phương pháp tối ưu hoá chính sách để giải quyết các bài toán điều khiển và quyết định. Sẵn lòng tham gia vào các dự án về học máy tăng cường và đóng góp ý kiến.", false, false, null, null, null, "$2a$04$FkX1Z1iJdEki68AWZTb7UenoSjvba6jYKQg/J3WevQzvvmvPz0Qse", null, true, "i44.png", null, null, (short)0, true, "Hamlen Noel" },
                    { 45, 7, null, null, null, null, "r45.pdf", "537f02a1-8435-4c5c-bbe6-527694de265f", null, "bgermanp@edublogs.org", true, null, null, "Kỹ sư Machine Learning có kinh nghiệm trong việc xây dựng hệ thống gợi ý và hệ thống lọc cộng tác. Có kiến thức sâu về các thuật toán cơ bản như collaborative filtering và content-based filtering, cũng như các phương pháp tiên tiến như matrix factorization và deep learning. Nhiệt tình với việc nghiên cứu và triển khai các giải pháp gợi ý hiệu quả.", true, false, null, null, null, "$2a$04$BO2hCS7qr8nl4d0XO6kZTuyn1cscbAxsoQoos8kGBaGZozSDeJVoW", null, true, "i45.png", null, null, (short)1, true, "Bernardina German" },
                    { 46, 9, null, null, null, null, "r46.pdf", "96008883-9eb2-46b1-875a-d49c9f29e58d", null, "ometterickq@si.edu", true, null, null, "Kỹ sư Machine Learning với kỹ năng tốt về phân tích dữ liệu và dự báo. Có kinh nghiệm trong việc sử dụng các thuật toán học máy và thống kê để dự báo xu hướng và xu hướng trong dữ liệu. Sẵn lòng tham gia vào các dự án phức tạp và đóng góp ý kiến xây dựng mô hình.", true, false, null, null, null, "$2a$04$tSjWDxMvzPu9KblXaPaRZ.a0kRSUDaD9lidva9wVn68txT8E8aDp.", null, true, "i46.png", null, null, (short)0, true, "Ollie Metterick" },
                    { 47, 10, null, null, null, null, "r47.pdf", "0dbb032f-e8c9-40af-84c1-bf47b390e89d", null, "wglanertr@technorati.com", true, null, null, "Kỹ sư Machine Learning mới vào nghề, đầy nhiệt huyết và sẵn lòng học hỏi. Có kiến thức cơ bản về các thuật toán học máy và kinh nghiệm trong việc xử lý dữ liệu. Năng động và hợp tác trong môi trường làm việc nhóm.", true, false, null, null, null, "$2a$04$yimp1eJifnBgzhTPro9D9uKItP14jP5HRPZpPsL/36WCz7phoRCUW", null, false, "i47.png", null, null, (short)1, true, "Winna Glanert" },
                    { 48, 8, null, null, null, null, "r48.pdf", "e4668f24-67ad-4cc1-8414-842aa830c0e2", null, "plongdons@so - net.ne.jp", false, null, null, "Kỹ sư Machine Learning với kinh nghiệm rộng trong việc xử lý dữ liệu cấu trúc và không cấu trúc. Có kỹ năng tốt trong việc lựa chọn, triển khai và tinh chỉnh mô hình học máy. Sẵn lòng chia sẻ kiến thức và kinh nghiệm với đồng nghiệp mới.", true, true, null, null, null, "$2a$04$Mu71kQEib0BOLMwPRzYsm.U4CWkkjrGUPXS92zr6Z4yWM5DMkjaye", null, false, "i48.png", null, null, (short)0, true, "Perry Longdon" },
                    { 49, 7, null, null, null, null, "r49.pdf", "63511cd7-b28d-4c45-984e-8b89111faf6f", null, "sgrealisht@netvibes.com", false, null, null, "là một Project Manager có kinh nghiệm với niềm đam mê đưa sự hòa hợp vào mỗi dự án mà cô đảm nhận. Với lý lịch trong lĩnh vực kỹ thuật phần mềm, cô liên kết một cách trơn tru sự chuyên môn kỹ thuật với kỹ năng quản lý dự án. Sự bình tĩnh và kỹ năng giao tiếp mạnh mẽ của Namita khiến cô trở thành một nhà lãnh đạo tự nhiên, tài ba trong việc chỉ đạo đội ngũ đạt được kết quả dự án thành công. Sự yêu thích của Namita với âm nhạc và vũ điệu cổ điển Ấn Độ phản ánh qua cách tiếp cận quản lý dự án của cô, nơi cô điều phối các nhiệm vụ một cách chính xác và tinh tế, đảm bảo mọi khía cạnh của dự án diễn ra một cách hoàn hảo", false, true, null, null, null, "$2a$04$lVRSYIkuZsasAcJPy1FsyOitl6HybOG5rqT6jzZ.aRwp/EgmrLNI.", null, false, "i49.png", null, null, (short)1, true, "Salomi Grealish" }
                });

            migrationBuilder.InsertData(
                table: "AspNetUsers",
                columns: new[] { "Id", "AccessFailedCount", "Address", "AmountMoney", "BankAccountInfor", "BankName", "CVFilePath", "ConcurrencyStamp", "Dob", "Email", "EmailConfirmed", "FullNameOnIDCard", "IDNumber", "Introduction", "IsVeryfiedIdentity", "LockoutEnabled", "LockoutEnd", "NormalizedEmail", "NormalizedUserName", "PasswordHash", "PhoneNumber", "PhoneNumberConfirmed", "ProfilePicture", "SecurityStamp", "StarMedium", "Status", "TwoFactorEnabled", "UserName" },
                values: new object[,]
                {
                    { 50, 7, null, null, null, null, "r50.pdf", "674aed42-64f1-4747-83e1-42dabf6220b9", null, "vantoniuttiu@smugmug.com", true, null, null, "là một Project Manager năng động nổi tiếng với tư duy chiến lược và kế hoạch tỉ mỉ. Với lý lịch trong quản trị kinh doanh kết hợp với kinh nghiệm trong quản lý dự án, anh có góc nhìn độc đáo trong việc xử lý các dự án phức tạp. Phong cách lãnh đạo của Rajesh được đặc trưng bởi khả năng truyền cảm hứng và khích lệ các thành viên trong đội làm việc của anh để đạt được tối đa hiệu quả làm việc của họ. Lấy cảm hứng từ văn học và triết học cổ điển Ấn Độ, Rajesh tiếp cận quản lý dự án với tư duy toàn diện, luôn xem xét tầm nhìn toàn diện và hậu quả dài hạn của quyết định của mình", false, false, null, null, null, "$2a$04$JLiq0tTWaA6IJjXw1VdCq.2L2nqZwnICsp8RNPPCEMDqD/CYhe9UK", null, true, "i50.png", null, null, (short)1, false, "Vale Antoniutti" },
                    { 51, 6, null, null, null, null, "r51.pdf", "f5a03989-8281-4f6e-ac90-ce1818c468fd", null, "sdellv@sakura.ne.jp", false, null, null, "Alok là một Project Manager chuyên nghiệp nổi tiếng với cam kết kiên định đối với việc đạt được kết quả. Với lý lịch trong kỹ thuật cơ khí, anh có ánh mắt tinh tế và phương pháp giải quyết vấn đề một cách hệ thống. Phong cách lãnh đạo của Alok được đặc trưng bởi khả năng giữ bình tĩnh dưới áp lực và khả năng tìm ra các giải pháp hiệu quả cho những thách thức phức tạp. Lấy cảm hứng từ các triết lý cổ điển Ấn Độ, Alok tin rằng việc tự phản ánh và liên tục cải tiến là quan trọng, luôn cố gắng hoàn thiện kỹ năng quản lý dự án của mình và dẫn dắt đội ngũ của mình đến sự xuất sắc.", true, true, null, null, null, "$2a$04$qxZ0IO6WgnYGcXemkruc4uxe68Yb18G9HuxlstWmridNvTu0Ba2QC", null, false, "i51.png", null, null, (short)1, true, "Stanley Dell Casa" },
                    { 52, 5, null, null, null, null, "r52.pdf", "609fe1ba-52b0-4f54-88e6-394bd39eda0d", null, "rmcillroyw@amazon.de", true, null, null, "Neha là một Project Manager thông minh với sự linh hoạt và sự kiên nhẫn trong việc vượt qua môi trường dự án phức tạp. Với lý lịch trong công nghệ thông tin, cô giỏi sử dụng công nghệ để tối ưu hóa quy trình dự án và tăng cường hiệu suất làm việc. Phong cách lãnh đạo của Neha được đặc trưng bởi khả năng dễ dàng điều hành trong điều kiện không rõ ràng và tìm ra các giải pháp sáng tạo cho những thách thức mới nảy sinh. Lấy cảm hứng từ thần thoại Ấn Độ, Neha tiếp cận quản lý dự án với tinh thần kiên định và kiên nhẫn, tin rằng mọi trở ngại đều là cơ hội cho sự phát triển và học hỏi.", true, false, null, null, null, "$2a$04$2oO0.6Uv1ckhAZcOb8z4culCXZMy.piQcekvAvj/4enurWQ9ICgWK", null, false, "i52.png", null, null, (short)0, false, "Ronald McIllroy" },
                    { 53, 7, null, null, null, null, "r53.pdf", "1cc3162c-6339-4867-8818-fdc20d3ee608", null, "ktremouletx@tripod.com", true, null, null, "Arjun là một Project Manager hấp dẫn với tài năng xây dựng mối quan hệ mạnh mẽ và thúc đẩy sự hợp tác. Với lý lịch trong kỹ thuật xây dựng, anh mang đến một cách tiếp cận có cấu trúc và hệ thống cho các dự án của mình, đảm bảo mọi chi tiết được lập kế hoạch và thực hiện một cách tỉ mỉ. Phong cách lãnh đạo của Arjun được đặc trưng bởi tư duy chiến lược và khả năng truyền cảm hứng cho các thành viên trong đội làm việc của anh để tư duy sáng tạo. Lấy cảm hứng từ nguyên lý karma và dharma, Arjun tiếp cận quản lý dự án với tinh thần mục đích và trách nhiệm, luôn cố gắng tạo ra kết quả tích cực cho cả đội và các bên liên quan.", true, false, null, null, null, "$2a$04$Ua4kw.SZzryF0Ik6MT25d.5liMa2ymjQMp9JkLzagNoyJ0u8tn6P2", null, true, "i53.png", null, null, (short)0, false, "Kelley Tremoulet" },
                    { 54, 2, null, null, null, null, "r54.pdf", "885d072f-07bb-4e1a-937f-bbdcb8117fec", null, "sdunkersleyy@tuttocitta.it", false, null, null, "Ananya là một Project Manager chiến lược nổi tiếng với khả năng phân tích tinh tế và cách tiếp cận tiên tiến. Với lý lịch trong tài chính, cô có hiểu biết sâu sắc về các nguyên tắc kinh doanh và động lực thị trường, mà cô sử dụng để thúc đẩy thành công của dự án. Phong cách lãnh đạo của Ananya được đặc trưng bởi khả năng dự đoán các thách thức tiềm ẩn và tích cực giảm thiểu rủi ro, đảm bảo việc thực hiện dự án diễn ra một cách trơn tru. Lấy cảm hứng từ khái niệm 'jugaad' trong văn hóa Ấn Độ, Ananya hưởng ứng tư duy tiết kiệm và sáng tạo, luôn tìm kiếm các giải pháp sáng tạo để tối ưu hóa tài nguyên và tối đa hóa kết quả của dự án.", true, true, null, null, null, "$2a$04$w8fvqa9FwMX3X5byuleHROC8cyrkKlovsnj0wP2.3gqtngkxei15m", null, true, "i54.png", null, null, (short)0, true, "Sheffy Dunkersley" },
                    { 55, 10, null, null, null, null, "r55.pdf", "5ee985d9-5db8-4432-b0a0-281aa4b62408", null, "jyanceyz@redcross.org", false, null, null, "Vikram là một Project Manager tầm nhìn với khả năng tưởng tượng và thực hiện các dự án phức tạp một cách chính xác. Với lý lịch trong kiến trúc, anh mang đến một kết hợp độc đáo giữa sự sáng tạo và chuyên môn kỹ thuật cho công việc của mình. Phong cách lãnh đạo của Vikram được đặc trưng bởi tư duy chiến lược và khả năng truyền cảm hứng cho các thành viên trong đội làm việc của anh để tư duy sáng tạo. Lấy cảm hứng từ di sản kiến trúc phong phú của Ấn Độ, Vikram tiếp cận quản lý dự án như một hình thức biểu đạt sáng tạo, luôn thách thức giới hạn của sự đổi mới để mang lại kết quả ấn tượng.", false, false, null, null, null, "$2a$04$jf6Rqk83qj1yl409cxuhreyUG1c1nUwnwYOVRxs1NWDZs6SKwtGGy", null, true, "i55.png", null, null, (short)1, true, "Janifer Yancey" },
                    { 56, 8, null, null, null, null, "r56.pdf", "e0a72c5d-e8af-4299-9643-8339cd5a011a", null, "meble10@blog.com", true, null, null, " Tôi là một lập trình viên Full-Stack đến từ Bắc Kinh, Trung Quốc. Tôi đam mê việc lập trình và tận tâm với công việc của mình. Tôi có kinh nghiệm và kiến thức sâu rộng về cả phía Front-end và Back-end. JavaScript, React và Node.js là những công cụ tôi thường xuyên sử dụng để xây dựng ứng dụng web động và hiệu quả.", false, true, null, null, null, "$2a$04$mska6go1xMbwmnr.70jfM.iEagWviKq4inOQaGtcgEWwq1AJxQRJq", null, false, "i56.png", null, null, (short)1, false, "Marlene Eble" },
                    { 57, 10, null, null, null, null, "r57.pdf", "4b1d215b-ce9f-4819-a93e-28eb51a6053b", null, "nwoofendell11@msn.com", false, null, null, "Tôi đến từ Thượng Hải và là một lập trình viên Full-Stack. Tôi say mê với việc lập trình và đã tích luỹ được nhiều kinh nghiệm trong lĩnh vực này. Vue.js, Python và Django là những công nghệ mà tôi thường sử dụng để xây dựng các ứng dụng web hiệu quả và linh hoạt.", false, true, null, null, null, "$2a$04$DBZi1HoeEUQqbNyqZSTiCubVvMAQ6kR8cdjcv3tVwhgPHZGvgOj1a", null, true, "i57.png", null, null, (short)0, false, "Nonnah Woofendell" },
                    { 58, 10, null, null, null, null, "r58.pdf", "68d5a975-e092-4d83-ab82-925bd5cc8f49", null, "sdisbrow12@geocities.jp", true, null, null, "Tôi là một lập trình viên Full-Stack đến từ Thành Đô, Trung Quốc. Tôi đam mê công việc lập trình và luôn mong muốn học hỏi thêm nhiều công nghệ mới. Angular, Java và Spring Boot là những công cụ mà tôi thường sử dụng để xây dựng các ứng dụng web chất lượng và ổn định.", false, true, null, null, null, "$2a$04$4eP3.VFL0NjIuvGdUoHDaOG5Mfk06C6bUv.strqQkQoSg8oBZMf9S", null, false, "i58.png", null, null, (short)0, false, "Siward Disbrow" },
                    { 59, 4, null, null, null, null, "r59.pdf", "9d298d42-6cc4-4fc7-95c7-6124e21c7226", null, "rivy13@seattletimes.com", true, null, null, "Tôi đến từ Thâm Quyến và là một lập trình viên Full-Stack. Tôi có sở thích về việc tạo ra những ứng dụng web đa dạng và phức tạp. React, Python và Flask là những công nghệ mà tôi thường xuyên áp dụng để phát triển các dự án của mình.", true, true, null, null, null, "$2a$04$vJzxvWxQyFZSxn93ZO27v.LCpTLLTMQ11eRDwf29ifBH1Pb7UAlr6", null, true, "i59.png", null, null, (short)1, true, "Renie Ivy" },
                    { 60, 3, null, null, null, null, "r60.pdf", "72bc31bc-10d6-406e-82dc-87800cd7ea55", null, "dpostgate14@dyndns.org", true, null, null, "Tôi đến từ Thanh Đảo, Trung Quốc và là một lập trình viên Full-Stack. Tôi có kinh nghiệm trong việc xây dựng ứng dụng web từ đơn giản đến phức tạp. React, Express và MongoDB là những công nghệ mà tôi thường sử dụng để phát triển các dự án của mình.", false, true, null, null, null, "$2a$04$iv8jY88RTQil7kU4AcQdBu9rACTYdBaM4bHqEAKNzMtcILAMQrMs.", null, false, "i60.png", null, null, (short)0, true, "Delainey Postgate" },
                    { 61, 1, null, null, null, null, "r61.docx", "d96f93ef-6383-43d4-956a-63e4c0f153e3", null, "tmillea15@livejournal.com", true, null, null, "Tôi là một lập trình viên Full-Stack đến từ Thượng Hải, Trung Quốc. Tôi đam mê công việc lập trình và luôn mong muốn tìm hiểu về những công nghệ mới. Vue.js, Node.js và MongoDB là những công cụ mà tôi thường sử dụng để xây dựng các ứng dụng web hiệu quả và linh hoạt.", false, true, null, null, null, "$2a$04$fhss0ne.c0ZiobEa5D26He33GrBC2buGGvv.8Cj9NXAN86nm5dIZ2", null, false, "i61.png", null, null, (short)1, false, "Trix Millea" },
                    { 62, 3, null, null, null, null, "r62.docx", "e89de22d-73b1-4c4e-8744-e63d9562da9f", null, "lhallibone16@fc2.com", false, null, null, "Tôi đến từ Thành Đô và là một lập trình viên Full-Stack. Tôi có sở thích về việc phát triển các ứng dụng web và đã có nhiều kinh nghiệm trong lĩnh vực này. Angular, Java và Spring Boot là những công nghệ mà tôi thường sử dụng để xây dựng các ứng dụng web chất lượng và ổn định.", true, false, null, null, null, "$2a$04$oP4yak72I88kyY6CxWKWTur7mS0ZOk7RSkqLpAQTfmQkCfJmSGNuS", null, true, "i62.png", null, null, (short)1, false, "Leon Hallibone" },
                    { 63, 4, null, null, null, null, "r63.docx", "6aa14073-14b3-488f-b870-f8eeb04920e1", null, "kivushkin17@oakley.com", false, null, null, "Tôi đến từ Thâm Quyến, Trung Quốc và là một lập trình viên Full-Stack. Tôi có kinh nghiệm trong việc xây dựng các ứng dụng web đa dạng và linh hoạt. React, Python và Flask là những công nghệ mà tôi thường sử dụng để phát triển các dự án của mình.", true, false, null, null, null, "$2a$04$WuDoA27RGJ.tfHn2bzDUeuR/ZdDCloSNc66XlbwaYRrpkPE9qOkKe", null, true, "", null, null, (short)1, true, "Kari Ivushkin" },
                    { 64, 6, null, null, null, null, "r64.docx", "760b3397-7f3e-435d-a00b-699a5e00d32c", null, "apassman18@blogs.com", false, null, null, "Benjamin, armed with a background in computer science or software engineering, is a master of programming languages and game engines. He thrives on solving technical challenges and pushing the boundaries of what's possible in game development through innovative gameplay mechanics and cutting-edge technology", true, false, null, null, null, "$2a$04$COucln69MUQWz8WeMhR81eAYnCrOAr4ABIBwCsHSV32rMJgPYeTIW", null, true, "", null, null, (short)1, false, "Abigale Passman Benjamin" },
                    { 65, 2, null, null, null, null, "r65.docx", "5bc26d52-577e-4430-b655-19300c4edb35", null, "iewington19@tamu.edu", false, null, null, "Claire, with a degree in fine arts or graphic design, has a talent for creating visually stunning game worlds and characters. Her creativity knows no bounds as she crafts breathtaking landscapes, intricate character designs, and captivating animations that bring games to life.", true, false, null, null, null, "$2a$04$8h6SDxbdE1x65GFfC48uBOEadXN0mKucOXrKmHzHUf1MtvsRv2a7S", null, false, "", null, null, (short)0, false, "Igor Ewington Claire" },
                    { 66, 9, null, null, null, null, "r66.docx", "5672b288-d048-4833-89d1-2459d1cca484", null, "hangerstein1a@godaddy.com", true, null, null, "Tôi là một Backend Developer với 5 năm kinh nghiệm trong ngành công nghệ thông tin. Trình độ chuyên môn của tôi tập trung vào lập trình Java và Python, cùng với các kỹ năng vững về xử lý dữ liệu và tối ưu hóa hiệu suất. Tôi đã tham gia vào nhiều dự án lớn, từ các ứng dụng web đến các hệ thống quản lý cơ sở dữ liệu phức tạp. Sự kiên nhẫn và ham học hỏi là những điểm mạnh của tôi, và tôi luôn mong muốn thách thức bản thân để phát triển mỗi ngày.", false, false, null, null, null, "$2a$04$7ZK8ncz5okb46SXMi2aX/OFn9uu1KmEedijLd68QYqC5vfb82w2Me", null, false, "i66.png", null, null, (short)1, true, "Holmes Angerstein" },
                    { 67, 9, null, null, null, null, "r67.docx", "2738cddc-432f-4e95-bc2b-420cf16b65d8", null, "kfehely1b@amazon.co.jp", false, null, null, "một Backend Developer với 3 năm kinh nghiệm. Tôi có kiến thức sâu rộng về lập trình Python và Node.js, cũng như về các công nghệ liên quan đến cơ sở dữ liệu như MySQL và MongoDB. Tôi luôn muốn học hỏi và khám phá những công nghệ mới, và tôi tin rằng việc này giúp tôi ngày càng phát triển và đóng góp nhiều hơn trong dự án mà tôi tham gia.", false, true, null, null, null, "$2a$04$STs4qX6wgYma/k.0Qxap3.ApRyNYRZ.moD849n.URGRUZjVEuF7sS", null, false, "i67.png", null, null, (short)1, false, "Kasper Fehely" },
                    { 68, 5, null, null, null, null, "r68.docx", "32b3e1ea-27be-4211-8f6e-ca135f42da62", null, "jcassley1c@harvard.edu", false, null, null, "Tôi là một Backend Developer tận tụy với hơn 4 năm kinh nghiệm trong ngành phát triển phần mềm. Sở trường của tôi nằm ở việc xây dựng các hệ thống phức tạp bằng Java và PHP. Tôi luôn chú trọng đến việc viết mã sạch và hiệu quả, cũng như đảm bảo tính ổn định và bảo mật cho ứng dụng. Sự cam kết và trách nhiệm là hai đặc điểm quan trọng trong cách làm việc của tôi.", false, true, null, null, null, "$2a$04$4fFaXEcih4iFQOn40vDLx.9th9oc56K7njiCobya/QCj0tuCNqhs.", null, true, "i68.png", null, null, (short)0, true, "Janean Cassley" },
                    { 69, 3, null, null, null, null, "r69.docx", "029621bb-f3fb-4e17-b2a8-4031109467f1", null, "asparrow1d@networkadvertising.org", false, null, null, "Tôi chuyên sâu về lập trình PHP và Python, và đã tham gia vào nhiều dự án thành công từ các ứng dụng web đến hệ thống phân phối dữ liệu lớn. Tôi luôn tìm kiếm cơ hội để phát triển kỹ năng của mình và đóng góp vào sự thành công của dự án. Sự sẵn lòng học hỏi và tinh thần hợp tác là những phẩm chất quan trọng tôi luôn giữ vững.", true, false, null, null, null, "$2a$04$i5PUjd61xykHpVi29Wnylu2Wb35xOhzX/l2IR2lvdSM.C.SsXTmJa", null, false, "i69.png", null, null, (short)1, false, "Ammamaria Sparrow" },
