                    { 74, 8, null, null, null, null, "r74.docx", "28a26b12-aefc-45e8-81ea-089dc4c650f8", null, "shebden1i@cnn.com", false, null, null, "Tôi là một Backend Developer với kinh nghiệm hơn 4 năm làm việc trong lĩnh vực công nghệ thông tin. Trong thời gian làm việc, tôi đã tham gia vào nhiều dự án phát triển ứng dụng web và hệ thống quản lý cơ sở dữ liệu. Sự ham học hỏi và khả năng tìm hiểu nhanh chóng là điểm mạnh của tôi, và tôi luôn mong muốn được thử thách với những dự án mới và học hỏi từ những người đồng nghiệp.", true, true, null, null, null, "$2a$04$p6cGnSKNGM1kE7OUG3Euq.XECbZDAUejL7X0pO9pXk7BXl.BRVLwC", null, true, "i74.png", null, null, (short)0, false, "Stevena Hebden" },
