                    { 77, 7, null, null, null, null, "r77.docx", "17905f79-3529-47c3-bf61-a04881cc4393", null, "tthyng1l@amazonaws.com", false, null, null, "là một Frontend Developer trẻ trung và năng động, luôn tìm kiếm cơ hội để khám phá và học hỏi. Với kiến thức vững chắc về các công nghệ front-end hiện đại như React và Vue.js, cô luôn thúc đẩy sự sáng tạo và tính tương tác trong công việc của mình.", true, true, null, null, null, "$2a$04$HNHb9el7k9neXcn8WmeLPuSDUljCtJGJKByTvQ7TuTWEFT8wT.lG.", null, true, "i77.png", null, null, (short)1, true, "Tiffie Thyng" },
                    { 78, 9, null, null, null, null, "r78.docx", "3371c9b0-14a7-4fc8-ba53-75375f2d0622", null, "ihourston1m@webnode.com", true, null, null, "là một Frontend Developer tự hào về khả năng tạo ra các trải nghiệm người dùng mượt mà và hiệu quả. Với kinh nghiệm trong việc phát triển các ứng dụng web đa nền tảng, anh có khả năng làm việc hiệu quả cả độc lập và trong nhóm.", false, true, null, null, null, "$2a$04$OI7HTcyeydP00P8oaGK1yO7HfrJw5KcNGqcMZORhc5g6wuLcL19C.", null, false, "i78.png", null, null, (short)1, false, "Imelda Hourston" },
