                    { 138, 6, null, null, null, null, "r138.docx", "cb4c379a-aba4-4f98-a094-6f711ac2e549", null, "ihindenberger11@comcast.net", true, null, null, "Kỹ sư Machine Learning với kỹ năng vững về phát triển các hệ thống học máy sản phẩm. Có kinh nghiệm trong việc thiết kế, triển khai và duy trì các hệ thống học máy trực tuyến. Sẵn lòng tham gia vào các dự án mới và đóng góp ý kiến để cải thiện sản phẩm.", true, true, null, null, null, "$2a$04$qgLPn8llWqEm5jjHy1TSGOU2nQLrH92RCRdXMagLXxYMNGkNF9XPq", null, true, "i138.png", null, null, (short)0, false, "Iain Hindenberger" },
                    { 139, 10, null, null, null, null, "r139.docx", "4b8d7caf-e233-4853-973b-bc6c6936d03e", null, "fhurndall12@ehow.com", false, null, null, "Sự hiểu biết sâu sắc về các tiêu chuẩn và quy trình trong lĩnh vực công nghệ thông tin giúp tôi đảm bảo tính linh hoạt và tuân thủ đúng theo yêu cầu của dự án.", true, false, null, null, null, "$2a$04$0ckv4UysAYoKpEw2rCXgl.GW/Rv9s8jmIwFf3Mj0JqrbdbJ9a.WmO", null, true, "i139.png", null, null, (short)0, false, "Finn Hurndall" },
                    { 140, 1, null, null, null, null, "r140.pdf", "6f14313e-44b5-4fff-9e9f-0914aa41927a", null, "", true, null, null, "Khả năng tương tác tốt với đồng đội và khách hàng là một trong những ưu điểm mà tôi luôn coi trọng, giúp tạo ra một môi trường làm việc tích cực và hợp tác.", false, true, null, null, null, "$2a$04$phUshZOTURnxItMBc5GEeeQMCKlacHBq2tqtCjG2H3QdC4UEBYCfe", null, false, "i140.png", null, null, (short)1, true, "Codie Steaning" },
                    { 141, 8, null, null, null, null, "r141.pdf", "2005dbd4-0731-4448-afaf-116543086862", null, "khopfner14@samsung.com", false, null, null, "Tôi luôn đặt lợi ích của dự án lên hàng đầu, đảm bảo rằng mỗi quyết định và hành động của tôi đều được tối ưu hóa để đạt được mục tiêu cuối cùng của tổ chức.", true, true, null, null, null, "$2a$04$enBTJLJbh94SMTsfjT4jDeK26P.j80I1yRaeu3h6EWJJJzu1Uy9KG", null, true, "i141.png", null, null, (short)0, false, "Kendal Hopfner" },
                    { 142, 9, null, null, null, null, "r142.pdf", "f32e572f-de3e-432a-900d-158ed589d85f", null, "awilkenson15@pagesperso-orange.fr", false, null, null, "Kỹ năng phân tích và giải quyết vấn đề của tôi đã được kiểm chứng qua nhiều dự án thành công, từ những hệ thống quy mô nhỏ đến các ứng dụng phức tạp.", true, true, null, null, null, "$2a$04$uflZGGp/L7GxBvRJHgR2nOp7az1KU8t8E/try.iTyxOrRkvm4OcRq", null, true, "i142.png", null, null, (short)1, true, "Arron Wilkenson" },
                    { 143, 7, null, null, null, null, "r143.pdf", "35fa81c3-4196-42c8-aa06-910f745512e9", null, "jbrayley16@posterous.com", false, null, null, "Sự kiên nhẫn và kiên định là hai phẩm chất mà tôi mang lại, giúp tôi vượt qua mọi thách thức và đảm bảo tiến độ dự án luôn được duy trì.", true, false, null, null, null, "$2a$04$oWTYsE.EoLeicVCFyzT6d.a3nO2q1FTutxal/EcHyBe9ReA85wyMi", null, true, "i143.png", null, null, (short)0, true, "Jeannette Brayley" },
                    { 144, 8, null, null, null, null, "r144.pdf", "b94af338-368d-4c99-862a-2fa954e4de49", null, "mgodilington17@w3.org", false, null, null, "Với khả năng tư duy logic và sáng tạo, tôi luôn sẵn lòng đưa ra các ý tưởng mới và cải tiến để tối ưu hóa hiệu suất và chất lượng.", false, false, null, null, null, "$2a$04$AXRKNtMaHPBH5Ph0Vibc9OyIZJZExFtBdNeYET5DqZSPVhJ.E0L9K", null, true, "i144.png", null, null, (short)0, true, "Morgan Godilington" },
                    { 145, 1, null, null, null, null, "r145.pdf", "4dfdeec8-55a8-4e58-be82-63afc19e05ad", null, "klaingmaid18@bluehost.com", false, null, null, "Tôi đặt mục tiêu của mình là không chỉ hoàn thành công việc mà còn vượt xa mong đợi, đem lại giá trị thực sự cho tổ chức và dự án.", false, true, null, null, null, "$2a$04$HsHfCeneYTx/VgJuGVfiq.gLkQtp7CakoWgi3MTfhibqU/yaWl6u2", null, false, "i145.png", null, null, (short)0, false, "Kiah Laingmaid" },
                    { 146, 0, null, null, null, null, "r146.pdf", "7101da16-5f49-4598-8855-e4fe1cd31e63", null, "hfidge19@flickr.com", false, null, null, "Bằng sự cam kết và sự tự tin trong kỹ năng của mình, tôi tin rằng tôi có thể đóng góp một cách tích cực và hiệu quả vào mọi dự án mà tôi tham gia.", false, false, null, null, null, "$2a$04$xz/Ipe3qJGOVqMDTMv5zOuHGzkf8vm1GU2mYgk0vwmWXFsGlfrDW.", null, true, "i146.png", null, null, (short)0, true, "Henrieta Fidge" },
                    { 147, 2, null, null, null, null, "r147.pdf", "3d80d108-a7ea-4e1c-859e-75aa21e62da6", null, "ljohananoff1a@fastcompany.com", false, null, null, "Kỹ năng lãnh đạo của tôi đã được phát triển thông qua việc dẫn dắt các nhóm làm việc đa dạng, từ việc hướng dẫn các nhân viên mới đến việc điều phối công việc giữa các bộ phận khác nhau.", true, false, null, null, null, "$2a$04$i6N05y3h8XplMrTxaAoUWO.47cOim0o3OKKPXeCNJ9s.mCnNO6W0a", null, false, "i147.png", null, null, (short)1, true, "Loraine Johananoff" },
                    { 148, 9, null, null, null, null, "r148.pdf", "8b04edeb-a4dd-42be-a29d-2c83854a735c", null, "istanyland1b@usda.gov", false, null, null, "Sự kiến thức vững vàng về các công nghệ mới nhất cùng khả năng áp dụng chúng vào thực tế giúp tôi luôn là người đứng đầu trong việc đổi mới và cải tiến.", false, true, null, null, null, "$2a$04$y/Xjwk4AeC19qBtEFFNcb.LzwinAUWVGftXMnjgE8F7LyuiKSCTuO", null, true, "i148.png", null, null, (short)1, true, "Ivan Stanyland" },
                    { 149, 5, null, null, null, null, "r149.pdf", "f180d9a5-91e1-4dda-a97d-4f7ef4352d95", null, "fboase1c@mashable.com", false, null, null, "Tôi luôn đặt mình vào vị trí của người dùng cuối để đảm bảo rằng sản phẩm của chúng ta đáp ứng đúng nhu cầu và mang lại trải nghiệm tốt nhất cho họ.", true, false, null, null, null, "$2a$04$iEcnKDZMb1C1rxAqp3SHMeFcV6HW2xAKENj/XtvaKRhCNo4EJbbe.", null, true, "i149.png", null, null, (short)0, false, "Filippo Boase" },
                    { 150, 2, null, null, null, null, "r150.pdf", "efac0ebf-93bf-4ae0-a634-4c166ab32fb9", null, "cskells1d@feedburner.com", true, null, null, "Đam mê với công nghệ và sự ham học hỏi không ngừng giúp tôi luôn cập nhật với những xu hướng mới nhất và áp dụng chúng vào công việc hàng ngày.", true, false, null, null, null, "$2a$04$rDs5EPwx6Ne1SOl3FZTh5usNYrwa0UGIi0SrhT7n1wfFUq5i6T0Va", null, false, "i150.png", null, null, (short)0, false, "Cosette Skells" },
                    { 151, 6, null, null, null, null, "r151.pdf", "959e26b8-ce64-43c4-b64b-5c6ed3f38f89", null, "", false, null, null, "Tôi có khả năng làm việc hiệu quả cả độc lập và trong nhóm, đảm bảo rằng dự án luôn diễn ra một cách suôn sẻ và hiệu quả.", true, true, null, null, null, "$2a$04$fuoOkIC.6XrY2W4XkQzSqeIcZLqexOjIJXb2g2Z/Y3hZcn.8JFP7m", null, false, "i151.png", null, null, (short)1, true, "Lin Curme" },
                    { 152, 2, null, null, null, null, "r152.pdf", "09c565d9-db49-49c4-9f6e-c6037a161cf1", null, "dsearl1f@hugedomains.com", false, null, null, "Tôi đã xây dựng một mạng lưới liên kết rộng lớn trong ngành công nghiệp, từ các chuyên gia đến các đối tác chiến lược, giúp tôi có thể tận dụng tối đa các tài nguyên bên ngoài.", true, true, null, null, null, "$2a$04$2VjPNibMrhH1HEj2IBU8JOIqbhfJQsrqpd4NCcSybC0Obs4hQeI5S", null, false, "i152.png", null, null, (short)1, true, "Drona Searl" },
                    { 153, 2, null, null, null, null, "r153.pdf", "a096f3ea-0dc1-4332-80f3-6b9d666fd13a", null, "oheady1g@storify.com", false, null, null, "Sự tỉ mỉ và chi tiết trong công việc giúp tôi luôn duy trì chất lượng cao và độ tin cậy trong mọi sản phẩm và dịch vụ mà tôi tham gia.", true, false, null, null, null, "$2a$04$.dM1yWs4Y8z/K.bc1Tmp0eLU8czj08B.t4/Ic2Wrh1nsdblmtcdFm", null, true, "i153.png", null, null, (short)0, false, "Opalina Heady" },
                    { 154, 2, null, null, null, null, "r154.pdf", "d4a1e429-76a8-48aa-839d-97a275f88d66", null, "snendick1h@nsw.gov.au", false, null, null, "Tôi không ngừng nâng cao kỹ năng giao tiếp của mình để có thể truyền đạt thông điệp của dự án một cách rõ ràng và hiệu quả.", false, true, null, null, null, "$2a$04$4TulBvdQdwS/WivyNP0q8uqifbqbOk19OrjukUt/eBsnHHhhjpmnG", null, true, "i154.png", null, null, (short)1, false, "Sapphira Nendick" },
                    { 155, 8, null, null, null, null, "r155.pdf", "bd80a1f2-054c-4087-acbb-712da4f2556d", null, "lhartfield1i@webmd.com", true, null, null, "Tôi là người luôn tìm kiếm cơ hội để phát triển và thúc đẩy sự nghiệp của mình, đồng thời cống hiến hết mình cho mỗi dự án mà tôi tham gia.", false, false, null, null, null, "$2a$04$LqPxrMaNmt4C.M79HQk1AON845QXp6LghJfydzNStm1UkIqJ4QNjy", null, true, "i155.png", null, null, (short)1, false, "Lisbeth Hartfield" },
                    { 156, 1, null, null, null, null, "r156.pdf", "6819a6a8-86d3-42a6-b267-63b4cd3ed03c", null, "kburgiss1j@alibaba.com", false, null, null, "Bằng sự tận tụy và sự chuyên nghiệp, tôi cam kết sẽ mang lại giá trị và thành công cho tổ chức của bạn thông qua kinh nghiệm và kỹ năng trong lĩnh vực công nghệ thông tin.", false, true, null, null, null, "$2a$04$x9UhFYEU9GIiSC2HaDO.neGDhWo0jFw6.Lp93H9nhk1znCKewq0FO", null, false, "i156.png", null, null, (short)1, true, "Kimbra Burgiss" },
                    { 157, 8, null, null, null, null, "r157.pdf", "43ddc9c5-b1ee-4343-b161-82a362fa80ca", null, "swissby1k@mapquest.com", true, null, null, "Tôi là Chuyên Gia Sở Hữu Dữ Liệu:\n\n Tôi có kỹ năng trong việc quản lý và bảo quản dữ liệu liên quan đến API. Tôi thiết kế cơ sở dữ liệu và hệ thống lưu trữ để lưu trữ và truy xuất dữ liệu một cách hiệu quả, đảm bảo tính toàn vẹn và bảo mật của thông tin.", false, false, null, null, null, "$2a$04$RSm3WkWTt8EL/J.YyUk6m..oBKAW7AN4QrqJvzv0WUsvKs4zp08YG", null, true, "i157.png", null, null, (short)1, false, "Sayers Wissby" },
                    { 158, 6, null, null, null, null, "r158.pdf", "8c0ab889-c27b-4b8e-9dbc-a501830662a6", null, "dweale1l@ezinearticles.com", true, null, null, "Tôi là Chuyên Gia Tăng Tính Mở Rộng của API:\n\n Tôi tập trung vào việc thiết kế và triển khai các API có khả năng mở rộng dễ dàng. Tôi sử dụng các kiến thức và kỹ thuật tiên tiến để xây dựng các hệ thống có khả năng mở rộng ngang và dọc, đáp ứng nhu cầu mở rộng của người dùng.", false, false, null, null, null, "$2a$04$EigabtnWx0zZbYlOQPzWm.6.Dup9nLCGKWMLUazGsV3Bgrj1cDoe2", null, false, "i158.png", null, null, (short)1, false, "Dougie Weale" },
                    { 159, 8, null, null, null, null, "r159.pdf", "9cca95e0-d717-4216-b0e7-9a95f6c3f90a", null, "hbowley1m@army.mil", false, null, null, "Tôi là Nhà Phát Triển Tinh Tế và Dễ Thương:\n\n Tôi tạo ra các giao diện API dễ dàng sử dụng và thân thiện với người dùng. Tôi tập trung vào việc thiết kế các API có trải nghiệm người dùng tốt nhất có thể, từ việc đơn giản hóa quy trình tích hợp đến cung cấp tài liệu hướng dẫn chi tiết.", false, true, null, null, null, "$2a$04$u9PMxHVe2gWmjm2wfZoPBellFmXZPrbAslHAwnHQXTgsLpbe3V9xO", null, false, "i159.png", null, null, (short)0, true, "Hallie Bowley" },
                    { 160, 5, null, null, null, null, "r160.pdf", "9019eab0-4635-4591-bee0-64304e885a37", null, "dsagg1n@dailymotion.com", false, null, null, "Tôi là Chuyên Gia Quản Lý Phiên Bản API: \n\n Tôi đảm bảo quản lý phiên bản của các API một cách chuyên nghiệp và hiệu quả. Tôi thiết lập và tuân thủ các quy trình quản lý phiên bản để đảm bảo tính ổn định và tương thích giữa các phiên bản khác nhau của API.", true, true, null, null, null, "$2a$04$GRywuwmcaxsznjVQsIYJje2N5S73.56udrPQgUgsnrsH8xx7BF4hW", null, false, "i160.png", null, null, (short)0, false, "Dory Sagg" },
                    { 161, 1, null, null, null, null, "r161.docx", "0ad8de36-31ee-4032-8cf5-6b0ccd61362f", null, "", true, null, null, "Tôi là Người Đam Mê Học Tập và Chia Sẻ Kiến Thức: Tôi tận hưởng việc học hỏi và chia sẻ kiến thức của mình với cộng đồng. Tôi thường xuyên tham gia các hoạt động học tập và sự kiện, cũng như viết blog và tham gia diễn đàn để chia sẻ thông tin và kinh nghiệm với người khác.", false, false, null, null, null, "$2a$04$elJyNTPtvQL/WzYq2eCvfeMl/ZiucShYxg1mBpHZwUDYEJQf0qY7O", null, false, "i161.png", null, null, (short)0, false, "Cece Livesey" },
                    { 162, 4, null, null, null, null, "r162.docx", "9f15a902-e2e7-4947-9c30-325453edd3ce", null, "", false, null, null, "Hi, I'm Karen, a software engineer passionate about natural language processing (NLP) and human-computer interaction (HCI). I specialize in building conversational AI systems and chatbots that understand and respond to human language. Python, NLTK, and TensorFlow are my main tools for creating intelligent conversational agents.", false, true, null, null, null, "$2a$04$n7Yg9vTfaNFKy0418Y1HiesztR9T226DlNpj2LE/ekQq7TF1gnkBi", null, false, "i162.png", null, null, (short)0, false, "Keriann Yarranton" },
                    { 163, 7, null, null, null, null, "r163.docx", "11a67e42-3102-4597-a796-03e43bd68e3b", null, "nryhorovich1q@senate.gov", true, null, null, "Hello, I'm Leo, a software engineer with expertise in backend development and distributed systems. I thrive on architecting scalable and resilient systems that handle massive amounts of data with efficiency. Java, Scala, and Kafka are among my favorite technologies for building high-performance microservices architectures.", false, false, null, null, null, "$2a$04$uiMDTu8f6IPFzMi37xbrTesODfuJQkpqOhbO1WYUy.vbLtnnm0lC2", null, true, "", null, null, (short)0, false, "Nichols Ryhorovich" },
                    { 164, 6, null, null, null, null, "r164.docx", "3bf3e07c-a226-4b43-95d8-8e7c84dd8131", null, "idumblton1r@boston.com", true, null, null, "Hey there! I'm Mia, a software engineer passionate about e-commerce and digital payments. I specialize in building secure and reliable payment processing systems that facilitate seamless transactions. From integrating payment gateways like Stripe and PayPal to implementing fraud detection algorithms, I'm dedicated to enhancing the online shopping experience.", true, true, null, null, null, "$2a$04$fwr1HdFSqdcB7OBkFXjDhOfhJuPJJfqZngkvxJzl3.7R4956R2ucO", null, false, "", null, null, (short)0, false, "Ingamar Dumblton" },
                    { 165, 9, null, null, null, null, "", "d3185c60-e70b-40c3-b68d-089f37238a9c", null, "rst1s@reverbnation.com", false, null, null, "Hi, I'm Nate, a software engineer with a focus on virtual reality (VR) and augmented reality (AR) development. I enjoy creating immersive experiences that blur the lines between the digital and physical worlds. Unity and Unreal Engine are my go-to platforms for building interactive VR/AR applications that transport users to new realities.", false, false, null, null, null, "$2a$04$l3bC8iY7duGbJLmSy2.okOle.m/AmRSxJxCCqLAyZDv98xdIyV7RK", null, false, "", null, null, (short)1, true, "Rosabella St. Ledger" },
                    { 166, 8, null, null, null, null, "", "5738e77e-7a6a-4a18-9698-a79f63a3687b", null, "hblondel1t@nsw.gov.au", true, null, null, "Greetings! I'm Olivia, a software engineer specializing in web accessibility and inclusive design. I'm passionate about creating digital experiences that are accessible to all users, regardless of their abilities. WCAG guidelines and ARIA attributes are key elements of my toolkit for designing and developing inclusive web applications.", false, false, null, null, null, "$2a$04$FuaiTCbZoJf0l24bGfJDy.Nrnl.SakvETRlVM1T/g.1FS21.lK/aS", null, true, "i166.png", null, null, (short)1, false, "Huey Blondel" },
