                    { 168, 9, null, null, null, null, "", "b41b9a32-8fb7-4922-b9af-58a42e768479", null, "imenco1v@ucoz.com", true, null, null, "Hi there! I'm Quinn, a software engineer specializing in blockchain and decentralized applications (DApps). I'm fascinated by the potential of blockchain technology to revolutionize industries and empower individuals. Solidity and Ethereum are my primary tools for building smart contracts and decentralized protocols that enable trustless interactions.", false, true, null, null, null, "$2a$04$VfflMTC2rRZSAYlNMf6Ix.T9dpfUGFpjv//C.AQSngEIRWa9x.sW.", null, false, "i168.png", null, null, (short)0, false, "Ivie Menco" },
